import styled from "styled-components";

export const StyledLoginButton = styled.button`
  display: flex;
  flex-direction: row;
  justify-content: center;
  align-content: center;
  padding: 10px 28px;
  gap: 10px;
  
  
  width: 99px;
  height: 40px;
  
  
  background: #f43f5e;
  border-radius: 8px;
  border: none

  flex: none;
  order: 0;
  flex-grow: 0;
`;
